            <h3 class=""medium_heading""> II. OBJECTIFS PEDAGOGIQUES </h3>

            <div class=""sub_stand_out"">
                <h3 class=""small_heading""> II. 1. Origine du programme </h3>
                <p class=""description""> 
                    Le secteur des mines et carrières joue un rôle fondamental dans le développement économique de notre pays et de l’Afrique en général. Environ
                    deux-tiers des pays du continent concentrent des activités minières et plus de la moitié produisent des minerais pour le marché international. A lui
                    seul, il peut représenter jusqu’à 25% du PIB d’un Etat. En raison de la demande croissante en métaux des pays émergents (doublement de la
                    population urbaine en 30 ans, développement des infrastructures à un rythme soutenu), les ");
            WriteLiteral(@"perspectives à venir du secteur sont prometteuses.
                    Dans l’optique d’une croissance durable de leurs activités, les entreprises minières sont de plus en plus à la recherche de solutions et d’une main
                    d’œuvre spécialisé, dans la gestion des impacts sociaux et environnementaux liés à leurs activités : pollution, déplacement de population etc.
                </p>
            </div>

            <div class=""sub_stand_out"">
                <h3 class=""small_heading""> II. 2. Objectifs du programme </h3>
                <h3 class=""smaller_heading""> II.2.1. Objectif général </h3>
                <p class=""description""> 
                    L’objectif du Master 2 en Génie civil option Gestion Durable des Mines vise à former des professionnels capables d’identifier, d’évaluer et de
                    minimiser les impacts environnementaux des carrières et des mines.
                </p>

                <h3 class=""smaller_heading""> II.2.2. Objectifs spécifiques </h3");
            WriteLiteral(@">
                <p class=""description""> 
                    <strong> Commun à la mention </strong><br/>
                    L’apprenant, à l’issue de ce programme sera capable de :
                </p>
                <ul class=""one_list"">
                    <li> 
                        Savoir évaluer les risques liés à l’exploitation minière d’un site donné.
                    </li>
                    <li> 
                        Savoir traiter et/ou minimiser les risques lorsqu’ils interviennent (déchets miniers, eaux d’exhaure, rejets atmosphériques, etc.).
                    </li>
                    <li> 
                        Maîtriser la législation et le cadre de l’économie minérale.
                    </li>
                    <li> 
                        Utiliser des outils d’évaluation environnementale et effectuer l’audit environnemental d’une carrière ou d’un site minier.
                    </li>
                    <li> 
                        Mettre en place de");
